import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [],
    };
  }

  componentDidMount() {
    fetch(`https://jsonplaceholder.typicode.com/users`)
      .then((response) => {
                this.setState(
                  () => {
                    console.log("Set Value: ", response);
                    return { monsters: response };
                  },
                  () => {
                    console.log(this.state);
                  }
                );
      })
  }

  render() {
    return (
      <div className="App">
        <h1>Hi</h1>
      </div>
    );
  }
}

export default App;
